import React, { Component } from 'react'
import { Container } from 'react-bootstrap';
export default class home extends Component {
    render() {
        return (
            <>
            <div className="intro route bg-image">
            <div className="intro-content display-table">
            <div className="table-cell">
                <Container>
                <p className="display-6 color-d">Hello, world!</p>
                <h1 className="intro-title mb-4">I am JayPrakash</h1>
                <p className="intro-subtitle"><span className="text-slider-items">CEO Websol,Web Developer,Web Designer,Frontend Developer,Graphic Designer</span><strong className="text-slider"></strong></p>
                <p className="pt-3"><a className="btn btn-primary btn js-scroll px-4" href="#about" role="button">Know More</a></p>
                </Container>
            </div>
            </div>
            </div>
            </>
        )
    }
}
